  false,\n\t\"url\": null,\n\t\"notes\": \"This letter is in response to observation
  of bird resembling the Ivory-billed Woodpecker on Choctaw National Wildlife Refuge
  in October 2007 which you reported in a letter to this office dated January 11,
  2008. A field review was conducted on February 10, 2008 by refuge biologist Richardson
  based on the information and location of the observation. Our review of the area
  can not discount your observation nor can we substantiate the existence of the Ivory-billed
  woodpecker.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
